import React from 'react';
import './App.css';
import Home from './components/Home';
import Reviewme from './components/Reviewme';
import UpdateContactInfo from './components/UpdateContactInfo';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';


function App() {
  return (
    <>
      <div className="container-fluid">
        <BrowserRouter>
          <nav className='d-flex flex-row justify-content-evenly mb-3 bg-black text-white font-bold '>
            <h1>KarakaFamilyHealth</h1>
            <Link to="/" className='nav-link'>Home</Link>
          </nav>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/reviewme' element={<Reviewme />} />
            <Route path='/updatecontact' element={<UpdateContactInfo />} />
          </Routes>
        </BrowserRouter>


      </div>
    </>

  );
}

export default App;
